tables.table_schema:
CREATE TABLE Orders (
    order_id INT,
    customer_id INT,
    order_date DATE
);

CREATE TABLE Shipments (
    shipment_id INT,
    order_id INT,
    shipment_date DATE
);

CREATE TABLE Orders (
    order_id INT PRIMARY KEY,
    customer_name VARCHAR(50),
    order_date DATE,
    total_amount DECIMAL(10, 2)
);

CREATE TABLE orders (
    order_id UUID PRIMARY KEY,
    order_date DATE,
    total_amount FLOAT
);

CREATE TABLE shipments (
    shipment_id UUID PRIMARY KEY,
    order_id UUID REFERENCES orders(order_id),
    shipment_date DATE
);

CREATE TABLE returns (
    return_id UUID PRIMARY KEY,
    order_id UUID REFERENCES orders(order_id),
    return_reason TEXT
);

CREATE TABLE products (
    product_id UUID PRIMARY KEY,
    product_name TEXT,
    product_price FLOAT
);
